export const ElementDetails = ({ workout }: any) => {
  return (
    <div className="details">
      <h4>{workout.title}</h4>
      <p><b>Load: </b>{workout.load}</p>
      <p><b>Reps: </b>{workout.reps}</p>
      <p>{workout.createdAt}</p>
    </div>
  )
}
